import { Chart, Tooltip, Axis, Legend, Bar, Line} from "viser-react";
import * as React from "react";
import BankPersonal from "./React";


class ChartHistoryGroupColumn extends React.Component {
 constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      t: "daily"
    };

  }
  render() {

    return (
     <BankPersonal chartData={this.state.t} />

    );
  }
}
export default ChartHistoryGroupColumn;
